import React from 'react';
import { BrowserRouter, Route, Switch } from 'react-router-dom';
import App from './App';
import Dashboard from './Dashboard';
import BruiloftenMenu from './BruiloftenMenu';
import BuffetMenu from './BuffetMenu';
import { Link } from 'react-router-dom'

class Router extends React.Component{
    state={
        menuItems:''
    }
    redirect = (items) =>{
        this.setState={menuItems:items}
        return <Link to="/bruiloften"></Link>;
    }
    render(){
        console.log(this.state.menuItems);
        return(
            <BrowserRouter>
                <Switch>
                    <Route exact path="/" component={App}/>
                    <Route exact path="/dashboard" component={Dashboard}/>
                    <Route exact path="/bruiloften" component={BruiloftenMenu}/>
                    <Route exact path="/buffet" component={BuffetMenu}/>
                </Switch>
            </BrowserRouter>
        )
    }
}

export default Router;
